import React from "react";

function Header() {
  return (
    <div
      className="head"
      style={{
        boxShadow: "0 0 2px rgb(174, 214, 241)",
        borderRadius: "10px",
        width: "95%",
        margin: "10px auto",
        textAlign: "left",
        backgroundColor: "#D6EAF8",
        height:"100px"
      }}
    >
      <form className="form">
        <input
          style={{
            margin: "10px",
            boxShadow: "0 0 1px",
            border: "none",
            borderRadius: "3px",
          }}
          type="text"
          placeholder="Search"
        />
        <i class="ri-search-line" />
        <select
          style={{
            border: "none",
            width: "100px",
            height:"80px" ,
            margin: "20px",
            backgroundColor: "inherit",
          }}
        >
          <option>Relevance</option>
          <option>Home</option>
          <option>Explore</option>
        </select>
        <select style={{ border: "none", width: "100px", margin: "20px", backgroundColor: "inherit" }}>
          <option style={{margin: "20px"}}>All Brands</option>
          <option>BMW</option>
          <option>Audi</option>
          <option>Jaguar</option>
        </select>
      </form>
    </div>
  );
}

export default Header;
